import "./Main.css";
const Main = () => {
  return (
    <div className="main">
      <img className="image-icon3" alt="" src="/image3@2x.png" />
      <div className="sicilys-tuna-fishing-container">
        <span className="sicilys-tuna-fishing-container1" style={{"margin-bottom":"1em"}}>
          <p className="sicilys-tuna-fishing">{`Sicily’s Tuna Fishing Tradition `}</p>
          <p className="on-display-at">
            on Display at the Tonnara di Favignana
          </p>
        </span>
      </div>
    </div>
  );
};

export default Main;
